import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './header/Header';
import Task from './task/Task';

function App() {
  return (
    <div className="App">
     {/* <Header/> */}
     <Task/>
     <div className="row"> 
         <div class="LI-profile-badge"  data-version="v1" data-size="medium" data-locale="en_US" data-type="vertical" data-theme="dark" data-vanity="vignesh-k-5927b0182"><a class="LI-simple-link" href='https://in.linkedin.com/in/vignesh-k-5927b0182?trk=profile-badge'>Vignesh K</a></div>
      </div>
    </div>
  );
}

export default App;
